import React from 'react';
import '../css/Realisations.css';
import Photo1 from '../assets/images/hello.png';
import Photo2 from '../assets/images/competence.png';
import Photo3 from '../assets/images/cv.jpg';
import { 
    CCarousel,
    CCarouselItem,
    CImage,
    CCarouselCaption,
} from '@coreui/react'

const Realisations = () => {

  return (
    <div className="real_container">
        <CCarousel controls indicators style={{ width: '100vw', height: '100vh'}}>
        <CCarouselItem>
            <CImage className="d-block w-10" style={{height: '50%'}} src={Photo1} alt="slide 1" />
            <CCarouselCaption className="d-none d-md-block">
            <h5>First slide label</h5>
            <p>Some representative placeholder content for the first slide.</p>
            </CCarouselCaption>
        </CCarouselItem>
        <CCarouselItem>
            <CImage className="d-block w-10" src={Photo2} alt="slide 2" />
            <CCarouselCaption className="d-none d-md-block">
            <h5>Second slide label</h5>
            <p>Some representative placeholder content for the first slide.</p>
            </CCarouselCaption>
        </CCarouselItem>
        <CCarouselItem>
            <CImage className="d-block"  style={{height: '200px'}}  src={Photo3} alt="slide 3" />
            <CCarouselCaption className="d-none d-md-block">
            <h5>Third slide label</h5>
            <p>Some representative placeholder content for the first slide.</p>
            </CCarouselCaption>
        </CCarouselItem>
        </CCarousel>
    </div>
  );
};

export default Realisations;
